import React from "react";
import {FormGroup,InputLabel} from "@mui/material";
import {Button, FormControl, Input } from "@mui/base";
function Contact(){
    return(
        <div>
            <h1>Contact Form</h1>
            <FormGroup>
               <FormControl>
               <TextField id="outlined-basic" label="Outlined" variant="outlined" />
                <Input />
                </FormControl>
                <FormControl>
                <InputLabel>Password:</InputLabel>
                <Input />
                </FormControl> 
                <Button variant="contained" color="red">Submit</Button>
            </FormGroup>
        </div>
    )
}
export default Contact
